import HTTP from './component'
function App(){
  return (
    <>
      <HTTP.Get 
        url='http://'
        loading = {
          <p>Date id Loading...</p>
        }
        error = {
          <p>console.error();</p>
        }
      >
        {
          data => {
            return data.map(item => {
              <tr key={item.id}>
                <td>item.name</td>
              </tr>
            })
          }
        }

        </HTTP.Get>
    </>
  )
}
export default App;
